// Define the two user IDs you want to process
const userIds = [
  "crazysunil02"
];

// This will create two separate items for the next nodes to process
return userIds.map(id => ({
  json: {
    userId: id
  }
}));

// Get the array of video items from the input
const itemsArray = items[0].json.data.items;

// Map over the array to create a new, cleaner array of objects
const extractedData = itemsArray.map(item => {
  return {
    code: item.code,
    title: item.caption.text,
    video_url: item.video_url, // This is the temporary download URL
    reel_url: `https://www.instagram.com/reel/${item.code}` // This is the permanent shareable URL
  };
});

// Return the new array
return extractedData;
